import React from "react";
import { Link } from "react-router-dom";
import { connect } from "react-redux";

function Objetivos({ auth }) {
  return (
    <div className="row stylep" style={{ justifyContent: "center" }}>
      <h1>¿Qué obtendré en Starkclass.com?</h1>
      <div className="col-lg-5 col-md-6 text-center">
        <p>• Teoría y ejercicios propuestos actualizados.</p>
        <p>• Repaso Parcial y Final para la Pre. </p>
        <p>• Repaso de Admisión General ULima.</p>
        <p>• Resúmenes en Psicología y Procesos Históricos. </p>
        <p>• Sílabos y ejercicios del mismo centro UL. </p>
      </div>
      <div className="col-lg-4 col-md-6 text-center">
        <p>• Tracking Académico.</p>
        <p>• Asesoría Virtual.</p>
        <p>• Material descargable.</p>
        <p>• Fácil acceso desde cualquier dispositivo.</p>
        <p>• Ejercicios actualizados.</p>
      </div>

      <div className="col-md-12 m-auto" align="center">
        <br />
        <br />
        {auth.user.isPremium ? (
          <Link
            style={{
              color: "#FF4900",
              borderColor: "#FF4900",
              borderRadius: "0px",
              textTransform: "uppercase",
            }}
            className="btn btn-lg shadow-lg my-4 mx-auto"
            aria-pressed="true"
            to={{
              pathname: "/rep",
            }}
          >
            Ver clases
          </Link>
        ) : (
          <Link
            style={{
              color: "#FF4900",
              borderColor: "#FF4900",
              borderRadius: "0px",
              textTransform: "uppercase",
            }}
            className="btn btn-lg shadow-lg my-4 mx-auto"
            aria-pressed="true"
            to={{
              pathname: "/pago",
            }}
          >
            Comprar
          </Link>
        )}
        <br />
      </div>
    </div>
  );
}
const mapStateToProps = (state) => ({
  auth: state.auth,
});

const mapDispatchToProps = (dispatch, props) => ({});

export default connect(mapStateToProps, mapDispatchToProps)(Objetivos);
